import React, { useRef } from "react";
import styled from "styled-components";
import { colorGreen } from "../styles";

const ChartWrapper = styled.div`
  height: 100%;
  width: 100%;

  border: 1px solid red;

  rect {
    fill: ${colorGreen};
  }
`;

const BarChart = () => {
  const divRef = useRef()
  return <ChartWrapper ref={divRef} />;
};

export default BarChart;
